package br.com.peladafc.apppeladafc.ws;import java.io.IOException;import java.util.List;import br.com.peladafc.apppeladafc.model.Time;import br.com.peladafc.apppeladafc.model.Usuario;import br.com.peladafc.apppeladafc.util.UtilJson;import retrofit2.Call;/** * Created by renanjunior on 9/12/16. */public class UsuarioService {    public List<Usuario> GetUsuario() {        Call<List<Usuario>> call = ((UsuarioInterface)RestClient.getInstance(UsuarioInterface.class)).getUsuario() ;        List<Usuario> usuarios = null;        try {            usuarios = call.execute().body();        } catch (IOException e) {            e.printStackTrace();        }        System.out.print("Teste : " + usuarios);        return usuarios;    }}